/* Calculates webbing type used to determine webbing length. Length is used on all cassettes. If Std webbing is used in any cassette then this is the max length for the rest regardless if MAX. */
decimal Extra = 0m;
decimal Top = 0m;
decimal Mid = 0m;
decimal Bot = 0m;
decimal CalcSum = 0m;

if (Inputs.var_webbingtypeextra.Value=="STD") {Extra=10;}
if (Inputs.var_webbingtypeextra.Value=="MAX") {Extra=1;}
if (Inputs.var_webbingtypeextra.Value=="RCV") {Extra=0;}

if (Inputs.var_webbingtypetop.Value=="STD") {Top=10;}
if (Inputs.var_webbingtypetop.Value=="MAX") {Top=1;}
if (Inputs.var_webbingtypetop.Value=="RCV") {Top=0;}

if (Inputs.var_webbingtypemid.Value=="STD") {Mid=10;}
if (Inputs.var_webbingtypemid.Value=="MAX") {Mid=1;}
if (Inputs.var_webbingtypemid.Value=="RCV") {Mid=0;}

if (Inputs.var_webbingtypebot.Value=="STD") {Bot=10;}
if (Inputs.var_webbingtypebot.Value=="MAX") {Bot=1;}
if (Inputs.var_webbingtypebot.Value=="RCV") {Bot=0;}

CalcSum = Extra + Top + Mid + Bot;

if (CalcSum == 0) {Inputs.chr_webbingtype.Value="RCV"; }
if ((CalcSum < 9) && ( CalcSum !=0)) {Inputs.chr_webbingtype.Value="MAX"; }
if (CalcSum > 9) {Inputs.chr_webbingtype.Value="STD"; }

